import React, { useState } from "react"
import Input from "../components/Input"

const Form = ({ type }) => {
  const [user, setUser] = useState()

  const handleChange = (name, value) => {
    setUser((prevState) => {
      return {
        ...prevState,
        [name]: value,
      }
    })
  }
  return (
    <form>
      <Input
        onChange={(e) => handleChange(e)}
        label="email"
        name="email"
      ></Input>
      <Input
        onChange={(e) => handleChange(e)}
        label="password"
        name="password"
      ></Input>
      <button></button>
    </form>
  )
}

export default Form
